CustomField.formula:
IF(
    AND(
        NOT(ISBLANK(CreatedDate)),
        NOT(ISBLANK(Data_interna__c))
    ),
    ROUND(
        (
            ( 
                Data_interna__c - DATEVALUE(Data_e_Hora_de_In_cio__c) 
            ) * 1440
            - Tempo_parado__c
        ) / 60,
        2
    ),
    NULL
)
